ASCII_BITS = 8

def int_to_bits(n):
	result = []
	if n == 0:
		return [0]
	while n > 0:
		result = [n % 2] + result
		n = n / 2
	while len(result) % ASCII_BITS != 0:
		result = [0] + result
	return result

